import React from "react";

export default function Planes() {
  const colorRids = "#01B9E6"; // üí† color principal que mencionaste

  const planes = [
    {
      nombre: "B√°sico",
      precio: "$29.990",
      caracteristicas: [
        "1 sitio web optimizado",
        "Soporte por correo",
        "Dominio .cl incluido",
        "Certificado SSL",
      ],
    },
    {
      nombre: "Profesional",
      precio: "$59.990",
      caracteristicas: [
        "3 sitios web responsivos",
        "Soporte prioritario 24/7",
        "Dominio + hosting incluido",
        "Optimizaci√≥n SEO avanzada",
      ],
      destacado: true,
    },
    {
      nombre: "Empresarial",
      precio: "$99.990",
      caracteristicas: [
        "Sitios ilimitados",
        "Soporte VIP dedicado",
        "Infraestructura personalizada",
        "An√°lisis y reportes mensuales",
      ],
    },
  ];

  const comparativa = [
    ["Hosting incluido", "‚úÖ", "‚úÖ", "‚úÖ"],
    ["Dominio personalizado", "‚úÖ", "‚úÖ", "‚úÖ"],
    ["Optimizaci√≥n SEO", "‚ùå", "‚úÖ", "‚úÖ"],
    ["Soporte 24/7", "‚ùå", "‚úÖ", "‚úÖ"],
    ["Consultor t√©cnico dedicado", "‚ùå", "‚ùå", "‚úÖ"],
  ];

  return (
    <section className="bg-[#0A0F1F] py-24 relative overflow-hidden">
      <div className="absolute inset-0 bg-gradient-to-b from-[#0A0F1F] via-[#0B1530] to-[#0A0F1F] opacity-90" />

      <div className="relative z-10 max-w-6xl mx-auto px-6 text-center">
        <h2
          className="text-4xl md:text-5xl font-extrabold text-transparent bg-clip-text mb-3"
          style={{
            backgroundImage: `linear-gradient(90deg, ${colorRids}, #00FFC6)`,
          }}
        >
          Nuestros Planes
        </h2>
        <p className="text-gray-400 mb-16 text-lg">
          Escoge el plan que mejor se adapte a tus necesidades. Flexibles, potentes y escalables.
        </p>

        {/* üßä Tarjetas */}
        <div className="grid grid-cols-1 md:grid-cols-3 gap-8 mb-20">
          {planes.map((plan, index) => (
            <div
              key={index}
              className={`relative group rounded-2xl p-[2px] transition-transform duration-300 hover:-translate-y-2 ${
                plan.destacado ? "scale-105" : ""
              }`}
              style={{
                background: `linear-gradient(135deg, ${colorRids}, transparent 60%)`,
              }}
            >
              <div className="bg-[#0D1328] rounded-2xl p-8 h-full flex flex-col items-center justify-between transition-all duration-500 group-hover:shadow-[0_0_25px_#01B9E655]">
                <div>
                  <h3
                    className="text-2xl font-semibold mb-2 text-white"
                    style={{
                      color: plan.destacado ? colorRids : "#fff",
                    }}
                  >
                    {plan.nombre}
                  </h3>
                  <p className="text-4xl font-bold text-white mb-6">
                    {plan.precio}
                  </p>
                  <ul className="text-left space-y-2 text-gray-300">
                    {plan.caracteristicas.map((c, i) => (
                      <li key={i} className="flex items-center gap-2">
                        <span className="text-[#01B9E6]">‚Ä¢</span>
                        {c}
                      </li>
                    ))}
                  </ul>
                </div>

                <button
                  className="mt-8 bg-gradient-to-r from-[#01B9E6] to-[#00FFC6] text-black font-semibold px-6 py-2 rounded-xl transition-all duration-300 hover:scale-105 hover:shadow-[0_0_20px_#01B9E6aa]"
                >
                  Elegir Plan
                </button>
              </div>
            </div>
          ))}
        </div>

        {/* üßÆ Tabla comparativa */}
        <div className="overflow-x-auto">
          <h3 className="text-2xl font-semibold mb-6 text-[#01B9E6]">
            Comparativa de planes
          </h3>
          <table className="min-w-full border border-[#01B9E6] rounded-xl overflow-hidden">
            <thead className="bg-[#101936] text-white">
              <tr>
                <th className="p-4 text-left">Caracter√≠sticas</th>
                {planes.map((p, i) => (
                  <th key={i} className="p-4 text-[#01B9E6] font-semibold">
                    {p.nombre}
                  </th>
                ))}
              </tr>
            </thead>
            <tbody className="text-gray-300">
              {comparativa.map(([caract, b, p, e], i) => (
                <tr
                  key={i}
                  className="transition-colors hover:bg-[#01B9E615]"
                >
                  <td className="p-4 border-t border-[#01B9E640] text-left">
                    {caract}
                  </td>
                  <td className="p-4 border-t border-[#01B9E640]">{b}</td>
                  <td className="p-4 border-t border-[#01B9E640]">{p}</td>
                  <td className="p-4 border-t border-[#01B9E640]">{e}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </section>
  );
}
